window.bookSummaryJSON = "<p><b>As above, so below...who was once friend is now a foe.</b></p> <p>The Faire is alive. It’s alive, it’s sentient, and it wants more from Cora Glass. Reeling from the revelations that Clown left her with, she struggles once more to find her footing. She never gets the chance.</p> <p>Harrow Faire wants Cora for murder. She assumed it was her death that it was after. She was wrong. It wants her to kill...to save them all. But the question remains - is Cora a murderer? Can she take a life, even if she is told she must?</p> <p>Faced with someone from her past she thought she would never see again...she is forced to find the answer.</p>"; 
